function LoadAutoCompleteData(){$(".or-autocomplete").autocomplete({source:function(n,t){let i=$(this)[0].element[0].id,r=$("#btn_PtsForList"+GetSuffixNumeric(i)),u=OpenReferentialForAutocomplete(r.attr("onclick")),f=ExtractLast(n.term);$.ajax({url:"WebServices/ReferentialWebService.asmx/LoadAutoCompleteData",data:"{ 'request': '"+f+"','controlId': '"+i+"','openReferential': '"+u+"'}",dataType:"json",type:"POST",contentType:"application/json; charset = utf-8",dataFilter:function(n){return n},success:function(n){t($.map(n.d,function(n){return{value:n}}))},error:AutocompleteError})},minLength:3,focus:function(){let n=$(this).attr("id");if($("#"+n).val().indexOf(";")>-1)return!1},select:function(n,t){let i=$(this).attr("id");if($("#"+i).val().indexOf(";")>-1){let n=this.value.split(";");return n.pop(),n.push(t.item.value),this.value=n.join(";"),OperatorToEqual(i),!1}OperatorToEqual(i)},search:function(){let n=ExtractLast(this.value);if(n.length<3)return!1}})}function OperatorToEqual(n){$("#ddlOperator"+GetSuffixNumeric(n)).val("=")}function GetSuffixNumeric(n){return n.match(new RegExp("\\d+$"))[0]}function ExtractLast(n){return n.split(";").pop()}$(document).ready(function(){LoadAutoCompleteData()});